import { Stack, TextField } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import Nav from "../Nav/Nav";

const NewExpense = () => {
  return (
    <>
      <Nav />
      <Stack sx={{ margin: "2rem", display: "flex", flexDirection: "column" }}>
        <TextField variant="outlined" label="Item"></TextField>
        <TextField type="number" variant="outlined" label="Amount"></TextField>
      </Stack>
    </>
  );
};

export default NewExpense;
